        <div className="Mainscreen">
            <UserTicker user={dummyUser.name}></UserTicker>
            <LevelTicker
                earnPerTap={0}
                coinsToLevelUp={0}
                profitPerHour={0}
                coins={0}
            ></LevelTicker>
        </div>
    )
}

export default MainScreen
